import React, { useEffect, useState } from 'react'
import Navbar from '../Component/Navbar';
import axios from "axios"
import "./All.css"
import { useNavigate } from 'react-router-dom';
import Detail from './Detail';

const Docs = () => {
    const [karakter, setKarakter] = useState([])
    const IdAtama=useNavigate()

    useEffect(() => {
        const api_link = "https://api.disneyapi.dev/character"
        axios.get(api_link)
            .then(response => {
                setKarakter(response.data)
            })
    }, [])

    console.log(karakter, "karakter");



    return (
        <><br />
            <Navbar /><br /><br /><br /><br/>

            <div class="btn-group-vertical" role="group" aria-label="Vertical button group">
                {
                    karakter.data?.map((liste, i) =>
                        <button key={i} onClick={()=>IdAtama(`/Docs/Detail/${liste._id}`)} style={{textAlign:"left"}} type="button" class="btn btn-light">
                            {liste.name}
                        </button>
                    )
                }
            </div>










        </>
    )
}

export default Docs;
